            'cv' => new Analog4Track(),
            'fx' => new Analog4Track(),
            'plocks' => new Arr(fn() => new Analog4Plock(), 128),
            'master_len' => new Int16(range(2, 1024) + ['INF' => 1]),
            'master_chng' => new Int16(range(2, 1024) + ['OFF' => 1]),
            'unknown_1' => new Unknown(1),
            'swing' => new Int8_1(range(0, 30)),
            'unknown_1' => new Unknown(1),
            'master_scale' => new Int8_1(['1X' => 2, '1/8X' => 6, '1/4X' => 5, '1/2X' => 4, '3/4X' => 3, '3/2X' => 1, '2X' => 0]),
            'global_quantize' => new Int8_1(),
            'unknown_2' => new Unknown(8),
        ];
    }

    public function fromSysex(array $data): void {
        // Ensure length
        $this->ensureLen($data, self::LEN);

        // Discard header and footer
        $data = array_slice($data, 10, self::LEN - 10 - 1);

        // Pick off checksum
        $data_len = count($data);
        $cksum_hi = $data[$data_len - 4];
        $cksum_lo = $data[$data_len - 3];
        $cksum = ($cksum_hi << 7) + $cksum_lo;

        // Calc checksum
        $data_to_cksum = array_slice($data, 0, -4);
        $cksum_calc = $this->checksum($data_to_cksum);

        // Ensure checksums match
        if ($cksum_calc !== $cksum) {
            throw new \RuntimeException(sprintf(
                "Expected checksum %d but saw %d",
                $cksum_calc,
                $cksum
            ));
        }

        // Decode 7bit
        $data = $this->decode7bit($data_to_cksum);

        // Parse
        parent::fromSysex($data);
    }

    public function toSysex(): array {
        $data = parent::toSysex();

        // Encode 7bit
        $data = $this->encode7bit($data);

        // Add checksum
        $cksum = $this->checksum($data);
        $data[] = ($cksum >> 7) & 0x7f;
        $data[] = $cksum & 0x7f;

        // Add length
        $len = self::LEN - 10;
        $data[] = ($len >> 7) & 0x7f;
        $data[] = $len & 0x7f;

        // Add sysex footer
        $data[] = 0xf7;

        // Add sysex header
        $data = array_merge(array_slice(self::DEFAULT, 0, 10), $data);

        return $data;
    }
}
